import React from "react";
import { makeStyles, withStyles } from "@material-ui/core/styles";
import { TextField, Typography, Button, Grid, Box } from "@material-ui/core";
import Arrow from "@material-ui/icons/Send";
import Footer from "./Footer";

const useStyles = makeStyles((theme) => ({
  contactContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    background: theme.palette.accent2.main,
    height: "600px",
    // border: "2px white solid",
  },
  form: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-between",
    width: "55%",
    border: "2px white solid",
    margin: "-3rem 0 0 0",

    // top: "50%",
    // left: "50%",
    // transform: "translate(-50%, -50%)",
    // position: "absolute",
  },
  button: {
    margin: "1rem 0 0 0",
    // color: "tomato",
    // borderColor: "tomato",
  },
  heading: {
    // color: "tomato",
    textAlign: "center",
    // textTransform: "uppercase",
    margin: "0 0 3rem 0",
  },
}));

// const InputField = withStyles({
//   // https://material-ui.com/customization/components/ docs here
//   // withStyles, not makeStyles
//   root: {
//     "& label.Mui-focused": {
//       // find these classes inspect element, styles
//       color: "tomato",
//     },
//     "& label": {
//       color: "tomato",
//     },
//     "& .MuiOutlinedInput-root": {
//       "& fieldset": {
//         borderColor: "tan",
//       },
//       "&:hover fieldset": {
//         borderColor: "tan",
//       },
//       "&.Mui-focused fieldset": {
//         borderColor: "tan",
//       },
//     },
//   },
// })(TextField);

const Contact = () => {
  const classes = useStyles();
  return (
    <Box className={classes.contactContainer} component="div">
      <Grid container justify="center">
        <Box component="form" className={classes.form}>
          <Typography className={classes.heading} variant="h5">
            tell me something
          </Typography>
          <TextField
            fullWidth={false}
            label="Name (optional)"
            // variant="outlined"
            // inputProps={{ style: { color: "white" } }} // this is how to change the input text color
            // margin="dense"
            size="medium"
          />
          <br />
          <TextField
            fullWidth={true}
            label="Name (optional)"
            // variant="outlined"
            // margin="dense"
            size="medium"
          />
          <br />
          <Button
            className={classes.button}
            variants="fill"
            fullWidth={false}
            endIcon={<Arrow />}
          >
            submit
          </Button>
        </Box>
      </Grid>
      <Footer />
    </Box>
  );
};

export default Contact;
